  return (
    <Global>
      <Header />
      <h1>Guest Book</h1>
      <p>Now is your chance to be heard (or read)!</p>
      <MessageForm />
      <Link className="link" href="/messages"><a>Check past messages!</a></Link>
      <style jsx>{`
        .link {
          margin-top: 10px;
        }
      `}
      </style>
    </Global>
  )

};

export default App
